            out Cell_ErrorMask errorMask,
            Cell_CopyMask copyMask = null,
            ICellGetter def = null,
            NotifyingFireParameters cmds = null,
            bool doMasks = true)
        {
            Cell_ErrorMask retErrorMask = null;
